import React,{useState} from 'react';
import {BsHouse} from 'react-icons/bs';
import {SiDatadog, SiGreenkeeper} from 'react-icons/si';
import Modal from 'react-modal';

const customStyles = {
  content: {
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
    color: 'SiGreenkeeper'
  },
};
Modal.setAppElement('#yourAppElement');
function refreshPage() {
    window.location.reload();
}
const Header = () => {
    const [modalIsOpen, setModalIsOpen] = useState(false);
    return (
        <>
        <h1 id='color'><SiDatadog/></h1>
        <div id='startSlide'>
            <h1> Fun Dog <BsHouse/> </h1>
        </div>
        <div id='navbar'>
            <ul className='navlink'>
                <li href='#'><button className='btn' onClick={refreshPage}>Refresh</button></li>
                <li href='#'><button className='btn' onClick={setModalIsOpen(true)}>Info</button></li>
            </ul>
        </div>
        </>
    )
}

export default Header
